import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleCheck, faPen, faTrashCan } from '@fortawesome/free-solid-svg-icons';

export const IngredientRow = ({payload, removeFromStore}) => {   
    return (
        <tr key={payload.id}>
            <td>{payload.id + 1}</td>
            <td>{payload.label}</td>
            <td>
                <form>
                    {100}
                    {payload.unit}
                    <FontAwesomeIcon icon={faPen} />
                </form>
            </td>
            <td>
                <button type="button" className="btn btn-danger" onClick={() => removeFromStore(payload.id)}>X</button>
            </td>
        </tr>
    )
}
